CREATE FUNCTION fspendquota(_time_begin timestamp without time zone) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE 
	_t2	timestamp;
BEGIN
	_t2 := clock_timestamp();
	UPDATE tuser SET spent = spent + extract (microseconds from (_t2-_time_begin)) WHERE name = session_user;
