--
-- Name: vmarket; Type: VIEW; Schema: public; Owner: olivier
--

CREATE VIEW vmarket AS
    SELECT ((tmarket.id + 4) / 4) AS market_session, CASE WHEN (((tmarket.id - 1) % 4) = 0) THEN 'OPENED'::ymarketstatus WHEN (((tmarket.id - 1) % 4) = 1) THEN 'STOPPING'::ymarketstatus WHEN (((tmarket.id - 1) % 4) = 2) THEN 'CLOSED'::ymarketstatus WHEN (((tmarket.id - 1) % 4) = 3) THEN 'STARTING'::ymarketstatus ELSE NULL::ymarketstatus END AS market_status, tmarket.created FROM tmarket ORDER BY tmarket.id DESC LIMIT 1;


